import React, { Component } from 'react'
import LoginForm from '../LoginForm/LoginForm'

export class UserLogin extends Component {
    render() {
        return (
            <div>
                <h1>This is Login Page</h1>
                
<Switch>
  <Route exact path="/login/buyer" component ={UserLogin}/>
  <Route exact path="/login/seller" component ={UserLogin} />
  <Route exact path="/login/admin" component ={UserLogin}/>


</Switch>

<BrowserRouter/>
            
            </div>
        )
    }
}

export default UserLogin
